import React from 'react';

import NavigationButton from './../../components/NavigationButton.js'
import BackButton from './../../components/BackButton.js'
import './Resume.css';

import resume from "./../../assets/resume-preview.png";

import PDF from "react-pdf-js";
<script type="text/javascript" src="https://platform.linkedin.com/badges/js/profile.js" async defer></script>

function Resume() {
  return (
      <div>
        <div className="resume">
            <a href="https://drive.google.com/file/d/1PqEBOfa-BTcA_8s2sghYpWHKMOYzbH9Z/view?usp=sharing" target="_blank">
                <img className="pdf" src={resume} />
            </a>
        </div>
        <div class="LI-profile-badge"  data-version="v1" data-size="medium" data-locale="en_US" data-type="vertical" data-theme="dark" data-vanity="izzielau"><a class="LI-simple-link" href='https://www.linkedin.com/in/izzielau?trk=profile-badge'>Izzie Lau</a></div>
      </div>
  );
}

export default Resume;
